import MaterialTable from 'material-table';
import React, {useEffect, useState} from 'react';
import tableIcons from '../templates/TableIcons';
import getColumns from './UsersColumns';
import Edit from "@material-ui/icons/Edit";
import { Switch } from "@material-ui/core";
import {withRouter} from "react-router";
import {AddBox} from "@material-ui/icons";
import {deleteUsers, getUsers} from "../../repo/usersRepo";
import { Loading } from "../templates/Loading";
import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css'
/*
Documentation on developing the Material-Table can be found at https://material-table.com/
*/

const UsersTable = (props) => {
    const history = props.history;
    const [columns, setColumns] = useState(getColumns({}));
    const [loading, setLoading] = useState(false);
    const [users,setUsers]=useState([])
    //Here we call delete
    const handleRowDelete = (oldData, resolve) => {
    setLoading(true);
        deleteUsers(oldData.id)
            .then(res => {
                resolve();
                setLoading(false);
            })
            .catch(error => {
                resolve();
                setLoading(false);
            })
    }
  
    useEffect(()=>{
        const fetchApi=async()=>{
            const { data }=await getUsers(0,10,"");
            console.log(data)
            setUsers(data)
        }
        fetchApi()
        
    },[])
    
    console.log(Object.entries(users))
    return (

    <div className="d-flex flex-wrap h-100 justify-content-center align-items-center w-100">
    {Object.entries(users).map(([Id, { name, email }]) => (
        <div className="Card shadow w-25 p-3 rounded">
        <div className="d-flex m-2 justify-content-between align-items-center">
            <div className=" shadow rounded-circle" style={{ height:"100px", width:"100px" }}></div>
            <div className="d-flex flex-column align-items-center">
                <h4>{name}</h4>
                <div><span className="label">{Email}</span></div>
            </div>
          
        </div>
        <div className="d-flex flex-column align-items-start">
                <div className="mb-2"><span className="label">  EmailVerifiedAt</span>{" : "} <span></span></div>
                <div className="mb-2"><span className="label">  Password</span>{" : "} <span></span></div>
                <div className="mb-2"><span className="label">  RememberToken</span>{" : "} <span></span></div>
                <div className="mb-2"><span className="label">  CompanyId</span>{" : "} <span></span></div>
                <div className="mb-2"><span className="label">  CreatedAt</span>{" : "} <span></span></div>
                <div className="mb-2"><span className="label">  UpdatedAt</span>{" : "} <span></span></div>
                <div className="mb-2"><span className="label">  CompanyIdValue</span>{" : "} <span></span></div>
            </div>
    </div>
    
    ))}
    </div>);
}
export default withRouter(UsersTable);
